import React from 'react';
import ReactDOM from 'react-dom';
import './Main.css'
import Header from '../Header/Header'
import './Main.css'

function Main() {
    return (
        <div className="main">
            <Header />
            <div className="main__page">
                <h2 className="main__title">Что творится в мире?</h2>
            </div>
        </div>
    )
}

export default Main;
